import styled from "styled-components";
import Texto from "../Texto";

const FooterStyle = styled.footer`
    display: flex;
    background-color: #FF3F00;
    height: 150px;

`;

function Footer() {
    return (
        <FooterStyle>
            <Texto>© MoveX</Texto>
            <Texto>© 2021 - Todos os direitos reservados</Texto>
        </FooterStyle>
    );
}

export default Footer;
